import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';

//import { BrowserRouter } from 'react-router-dom'
import Buttons from './Components/Buttons';

getPageFun=(page)=>
{
  var self=this;
  axios.get('http://localhost:4000/{page}')
  .then(function(response){

    console.log(response.data);
    //console.log(self.state.arrPosts);

  })
  .catch(function(error){
     console.log(error);
  });
}


class App extends Component {
  render() {
    return (
      <div className="App">
       <div className="row">
               <div className="col-3">
                   <Buttons page="P1" getPageFun={this.getPage}></Buttons>
               </div> 
               <div className="col-3">
                   <Buttons page="P2" getPageFun={this.getPage}></Buttons>
               </div>   
               <div className="col-3">
                   <Buttons page="P3" getPageFun={this.getPage}></Buttons>
               </div>   
               <div className="col-3">
                   <Buttons page="P4" getPageFun={this.getPage}></Buttons>
               </div>       

       </div>
       {/* <div className="row">
       {this.print()}
       </div> */}
     </div>
   )
  }
}

export default App;
